import { InputName } from "../reducers/FormReducers";
import { InputConfig } from "../components/UI/Form";

export const LoginStartingValues: InputConfig[] = [
  { name: "username" as InputName },
  { name: "password" as InputName, inputType: "password" }
];

export const RegistrationStartingValues = [
  { name: "username" as InputName },
  { name: "password" as InputName, inputType: "password" }
];
